INSERT INTO mst_healthcare_type (healthcare_type_uuid, healthcare_type_code, healthcare_type_name, healthcare_type_description, "version", is_active, created_date, created_by, modified_date, modified_by) VALUES
('0023d182-b424-4f1c-ae70-8b79404ccadb', 'MAGNETIC.RESONANCE.IMAGING', 'Magnetic Resonance Imaging', 'Uses magnetic resonance and radiofrequency pulses for static, dynamic and function imaging.[39]', 0, true, '2018-12-06 11:42:54', NULL, NULL, NULL),
('19d3690e-95a5-4027-90f8-aa9f94b2ca23', 'SURGICAL', 'Surgical/Theatre Radiography', 'Images anatomy and related pathology during surgical procedures', 0, true, '2018-12-06 11:42:54', NULL, NULL, NULL),
('2c7b3ffd-a541-494a-8d39-d2c38d6d42d7', 'ECHOCARDIOGRAPHY', 'Echocardiography', 'Utilises 2D, 3D and Doppler Sonography to image the heart.', 0, true, '2018-12-06 11:42:54', NULL, NULL, NULL),
('43d8b3b9-7430-4807-a356-a0bf5879095c', 'ANGIOGRAPHY', 'Angiography/Venography', 'Imaging of the cardiovascular system, may be diagnostic or therapeutic in nature. Is utilised under the specialities of Interventional radiology and/or cardiology within a Cath Lab (Catheterisation Laboratory).', 0, true, '2018-12-06 11:42:54', NULL, NULL, NULL),
('6b8fa8fa-4848-49a0-8a1a-fb3fd96ae39e', 'DIAGNOSTIC.RADIOGRAPHY', 'Diagnostic Radiography', 'Utilises ionising radiation in the examination of internal organs, bones, cavities and foreign objects.', 0, true, '2018-12-06 11:42:54', NULL, NULL, NULL),
('7fe6c452-6461-4832-a5d1-8db9ac494a17', 'COMPUTED.TOMOGRAPHY', 'Computed Tomography', 'Provides cross-sectional views (slices) of the body; can also reconstruct additional images from those taken to provide more information in either 2D or pseudo-3D.', 0, true, '2018-12-06 11:42:54', NULL, NULL, NULL),
('92b853ec-2ce5-47fe-895b-32911683c66a', 'NUCLEAR.MEDICINE', 'Nuclear Medicine (NM)/Radionuclide Imaging (RNI)', 'Uses radioactive tracers which can be administered to examine how the body and organs function. Certain radioisotopes can also be administered to treat certain cancers, such as thyroid cancer.', 0, true, '2018-12-06 11:42:54', NULL, NULL, NULL),
('aa58a51e-d5e4-489e-9de5-5967802b59b4', 'SONOGRAPHY', 'Sonography/Ultrasonography', 'Images anatomy and related pathology (such as cancer or cardiopulmonary diseases) using ultrasound waves. Obstetric ultrasonography is the use of ultrasonography to track the course of a pregnancy and detect certain embryonic or fetal malformations or diseases, which may be genetic and/or hereditary in nature. Gynecologic ultrasonography deals with imaging diseases or defects or abnormalities of the female genital and reproductive organs (ovaries, fallopian tubes, vagina, uterus, cervix, clitoris, labia, and breasts).', 0, true, '2018-12-06 11:42:54', NULL, NULL, NULL),
('ab15acea-5e02-477e-8264-b962ba3ce300', 'FLUOROSCOPY', 'Fluoroscopy', 'Utilises continuous and/or pulses of ionising radiation to visualise the various systems of in the body over period of time. Often used in monitoring a bolus or contrast agent in order to highlight vessels and organs, or to position devices within the body (such as pacemakers, guidewires, stents, etc.).', 0, true, '2018-12-06 11:42:54', NULL, NULL, NULL),
('ef2a4055-8c45-478c-9f4d-2cb19fa884e0', 'MAMMOGRAPHY', 'Mammography/Breast Radiography', 'Uses low dose ionising radiation systems to produce images for the diagnosis and/or staging of breast disease, primarily breast cancer.', 0, true, '2018-12-06 11:42:54', NULL, NULL, NULL);
